import numpy as np
import math

def DCG(label_list):
    dcgsum = 0.0
    for i in range(len(label_list)):
        dcg = (2**label_list[i] - 1)/np.log2(i+2)
        # dcg = float(2 ** label_list[i] - 1) /math.log(i+2,2)
        dcgsum += dcg
    return dcgsum


#ndcg 计算
def NDCG(label_list,top_n):
    #没有设定topn
    if top_n==None:
        dcg = DCG(label_list)
        ideal_list = sorted(label_list, reverse=True)
        ideal_dcg = DCG(ideal_list)
        if ideal_dcg == 0:
            return 0

        return dcg/ideal_dcg
    #设定top n
    else:
        dcg = DCG(label_list[0:top_n])
        ideal_list = sorted(label_list, reverse=True)
        ideal_dcg = DCG(ideal_list[0:top_n])
        if ideal_dcg == 0:
            return 0

        print(dcg)
        print(ideal_dcg)
        return dcg/ideal_dcg



